import { Skeleton } from 'antd';

const User = () => {
    return ( 
        <div className="site-card-border-less-wrapper">
            <Card  bordered={false} style={{ width: 300, backgroundColor: '#3A3C41', borderRadius:'20px', color:'white' }}>
                <Skeleton active />
            </Card>
            <Card  bordered={false} style={{ width: 300, backgroundColor: '#3A3C41', borderRadius:'20px', color:'white' }}>
                <Skeleton active />
            </Card>
        </div>
     );
}

export default User;
